import React, { ReactNode } from 'react';
import Head from 'next/head';
import { Nav } from './Nav';
import { Banner } from './Banner';
import { Slider } from './Slider';
import { Footer } from './Footer';

type Props = {
  children?: ReactNode;
  title?: string;
};

const Layout: React.FC<Props> = ({ title, children }) => (
  <React.Fragment>
    <Head>
      <title>{title}</title>
    </Head>
    <Nav />
    <Banner />
    <Slider />
    {children}
    <Footer />
    {/* {children} */}
  </React.Fragment>
);

export default Layout;
